	add("crocodile", "{\"term\":\"crocodile\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027cocodril\u0027 (modern \u0027crocodile\u0027 , from \u0027cocodrillus\u0027 from Latin \u0027crocodilus\u0027 from Ancient greek (to 1453) \u0027κροκόδειλος\u0027 () The word was later refashioned after the Latin and Greek forms.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the predatory amphibious reptiles of the family Crocodylidae; a crocodilian, any species of the order Crocodilia, which also includes the alligators, caimans and gavials\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Mwelwa Musambachime, \u0027Basic Facts on Zambia\u0027, [http://books.google.com.au/books?id\u003dPFM_gTrBjtIC\u0026amp;pg\u003dPA97\u0026amp;dq\u003d%22crocodile%22%7C%22crocodiles%22+-intitle:crocodile+-intitle:crocodiles\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXimGUom-DcbpkAWakoGwDw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22crocodile%22%7C%22crocodiles%22%20-intitle%3Acrocodile%20-intitle%3Acrocodiles\u0026amp;f\u003dfalse page 97\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Industrial and rural expansion is shrinking and destroying the Nile \u0027\u0027crocodile\u0027s\u0027\u0027 natural habitat. The Nile \u0027\u0027crocodiles\u0027\u0027, in particular, have been a source of highly durable leather for a variety of products which can be crafted and manufactured\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Walkter B. Wood, \u0027Chapter 16: Forensic Identification in Fatal \u0027\u0027Crocodile\u0027\u0027 Attacks\u0027, Marc Oxenham (editor), \u0027Forensic Approaches to Death, Disaster and Abuse\u0027, [http://books.google.com.au/books?id\u003djTxrFupDxYUC\u0026amp;pg\u003dPA244\u0026amp;dq\u003d%22crocodiles%22+-intitle:crocodile+-intitle:crocodiles\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003diy6GUrqAEsqtkAWv4YHgCA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22crocodiles%22%20-intitle%3Acrocodile%20-intitle%3Acrocodiles\u0026amp;f\u003dfalse page 244\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Two species of \u0027\u0027crocodile\u0027\u0027 inhabit Australian waterways: (a) the saltwater \u0027\u0027Crocodile\u0027\u0027 — \u0027Crocodylus porosus\u0027, and (b) the freshwater \u0027\u0027crocodile\u0027\u0027 — \u0027Crocodylus johnstoni\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Sam Thaker, \u0027The \u0027\u0027Crocodile\u0027s\u0027\u0027 Teeth\u0027, [http://books.google.com.au/books?id\u003dq6dsg7umKRwC\u0026amp;pg\u003dPA31\u0026amp;dq\u003d%22crocodile%22%7C%22crocodiles%22+-intitle:crocodile+-intitle:crocodiles\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dXimGUom-DcbpkAWakoGwDw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22crocodile%22%7C%22crocodiles%22%20-intitle%3Acrocodile%20-intitle%3Acrocodiles\u0026amp;f\u003dfalse page 31\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"One contained some brightly-coloured tropical birds, one a python and the other a large and very lively \u0027\u0027crocodile\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I told the customer that the boxes containing the \u0027\u0027crocodile\u0027\u0027 and the python were not packed to my satisfaction, as there were not enough nails securing them\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A long line or procession of people (especially children) walking together\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, \u0027Coming Up for Air\u0027, part 2, chapter\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Sometimes the kids from the slap-up boys\u0027 schools in Eastbourne used to be led round in \u0027\u0027crocodiles\u0027\u0027 to hand out fags and peppermint creams to the \u0027wounded Tommies\u0027, as they called us\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A fallacious dilemma, mythically supposed to have been first used by a crocodile\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"We have seen syllogisms, \u0027\u0027crocodiles\u0027\u0027, enthymemas, sorites, \u0026amp;c. explained and tried upon a boy of nine or ten years old in playful conversation\", \"priority\":16}]}, \"synonyms\":{\"list\":[{\"text\":\"croc\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("crocodiledom", "{\"term\":\"crocodiledom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crocodile|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a crocodile, or of belonging to the world of crocodiles; crocodiles, collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027, Henry Brooks, Robert James Mann, \u0027Natal; a History and Description of the Colony\u0027, page 126\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To the north his limit is not known, and most probably he has a continuous range, quite to the classic ground of \u0027\u0027crocodiledom\u0027\u0027, the waters of the Nile\", \"priority\":3}]}, \"synonyms\":{}}");

	add("croesus", "{\"term\":\"croesus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027κροῖσος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A king of Lydia, noted for his great wealth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003d\u0026amp;ldquo;[…]\u0026amp;nbsp;They talk of you as if you were \u0027\u0027Croesus\u0027\u0027—and I expect the beggars sponge on you unconscionably.\u0026amp;rdquo; And Vickers launched forth into a tirade very different from his platform utterances. He spoke with extreme contempt of the dense stupidity exhibited on all occasions by the working classes\", \"priority\":2}]}, \"synonyms\":{}}");

