	add("crony", "{\"term\":\"crony\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined between 1655 and 1665 from Ancient greek (to 1453) \u0027χρόνιος\u0027 (perennial, long-lasting) (English \u0027chrono-\u0027 (time) \u0026lt;ref\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt; initially as {{w|Cambridge University}} slang,\u0026lt;ref\u0026gt;[http://dictionary.reference.com/browse/crony \u0026quot;Crony\u0026quot; at Dictionary.com]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://www.askoxford.com/concise_oed/crony?view\u003duk AskOxford: crony]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Richard Reeves, NS Essay – “[http://www.newstatesman.com/200404190019 Friendship is the invisible thread running through society.]” April 19, 2004\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;“[http://news.bbc.co.uk/1/hi/special_report/1998/11/98/e-cyclopedia/241207.stm Cronyism: The New Sleaze.]” BBC News. December 23, 1998\u0026lt;/ref\u0026gt; in sense of “chum”, as “friend of long standing”,\u0026lt;ref name\u003d\u0026quot;safire\u0026quot;\u0026gt;“[http://www.nytimes.com/2005/10/30/magazine/30onlanguage.html The I’s Have It]”, {{w|William Safire}}, \u0027{{w|The New York Times}}\u0027. October 30, 2005\u0026lt;/ref\u0026gt; with illegal connotation later.\u0026lt;ref\u0026gt;“[http://www.ilocostimes.com/sep11-oct01-06/opinion_depth2.htm That Single Word.]” Juan L. Mercado, \u0027The Ilocos Times,\u0027 September 24, 2006\u0026lt;/ref\u0026gt;Early spellings included \u0027chrony\u0027 as in 1665 diary by {{w|Samuel Pepys}},\u0026lt;ref name\u003d\u0026quot;safire\u0026quot; /\u0026gt; supporting the Greek origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Close friend\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Washington Irvin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He soon found his former \u0027\u0027cronies\u0027\u0027, though all rather the worse for the wear and tear of time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Trusted companion or partner in a criminal organization\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An old woman; a crone\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Burto\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Marry not an old \u0027\u0027crony\", \"priority\":7}]}, \"synonyms\":{}}");

	add("cronehood", "{\"term\":\"cronehood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crone|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being an elderly woman; the time during which a woman is elderly\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, w:David David \u0026amp; Leigh Eddings, \u0027Polgara the Sorceress\u0027, Del Ray (1999), ISBN 0345422554, [http://books.google.com/books?id\u003dDFrQoeIasbYC\u0026amp;pg\u003dPA142 pages 142-143\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was a little vain, perhaps, but the notion of \u0027\u0027cronehood\u0027\u0027 sent me immediately to my mirror\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The elderly stage of a female Wiccan witch (compared with the Crone aspect of the Goddess\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Beverly Engel, \u0027Women Circling the Earth\u0027, [http://books.google.com/books?id\u003dOyWtOF3NjCcC\u0026amp;pg\u003dPA34\u0026amp;dq\u003dcronehood+wicca\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7qaLT5yvNcHbiALpw7XiCw\u0026amp;ved\u003d0CD4Q6AEwAjgK page 34\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Many circles create ceremonies to mark a woman\u0027s passage into \u0027\u0027cronehood\u0027\u0027 and designate special status to crone\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Ashleen O\u0027Gaea, \u0027Family Wicca: practical paganism for parents and children\u0027, [http://books.google.com/books?id\u003dIU7tXsL_gIwC\u0026amp;pg\u003dPA213\u0026amp;dq\u003dcronehood+wicca\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d76WLT6PBKoGziQKonuD7Cw\u0026amp;ved\u003d0CDQQ6AEwAA page 213\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An archaic term, really, but I like it. crone: A menopausal or post-menopausal Wiccan. The time at which a woman assumes her \u0027\u0027cronehood\u0027\u0027 is intensely individual\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Kevin M. Gardner, A Handbook for Wiccan Clergy, [http://books.google.com/books?id\u003dxw34gp1_q-gC\u0026amp;pg\u003dPA29\u0026amp;dq\u003dcronehood+wicca\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d76WLT6PBKoGziQKonuD7Cw\u0026amp;ved\u003d0CDkQ6AEwAQ page 29\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Grant (name) the gifts of inspiration, and a clear and quick mind as he/she approaches the honored state of (Sagehood/\u0027\u0027Cronehood\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Ruth Barrett, \u0027Women\u0027s Rites, Women\u0027s Mysteries: Intuitive Ritual Creation\u0027, [http://books.google.com/books?id\u003det09UA-9FZQC\u0026amp;pg\u003dPA9\u0026amp;dq\u003dcronehood+wicca\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d76WLT6PBKoGziQKonuD7Cw\u0026amp;ved\u003d0CFMQ6AEwBg page 9\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"She speaks her commitment to herself as an elder and to the aspects of \u0027\u0027cronehood\u0027\u0027 she will celebrate\", \"priority\":12}]}, \"synonyms\":{}}");

