	add("croquet", "{\"term\":\"croquet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) or\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A game played on a lawn, in which players use mallets to drive balls through hoops (wickets\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A shot in this game in which the striker\u0027s ball and another ball are moved by hitting the striker\u0027s ball when they have been placed in contact following a roquet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A croquette\", \"priority\":3}]}, \"synonyms\":{}}");

	add("croquette", "{\"term\":\"croquette\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027croquette\u0027 from \u0027croquer\u0027 (to crunch) + \u0027-ette\u0027 (pos\u003dsuffix indicating diminution)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Minced, cooked food (usually meat or vegetables), which is deep-fried in fat and sometimes sprinkled with bread crumbs\", \"priority\":1}]}, \"synonyms\":{}}");

