	add("crosier", "{\"term\":\"crosier\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) ; originally referring to the staff bearer, from a merger of Old french (842-ca. 1400) words \u0027crocier\u0027 (bearer of a cross) and \u0027croisier\u0027 (one who bears or has to do with a cross) ultimately from Latin \u0027crux\u0027 (cross)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A staff with a hooked end similar to a shepherd\u0027s crook, or with a cross at the end, carried by an abbot, bishop, or archbishop as a symbol of office\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A young fern frond, before it has unrolled; fiddlehead\", \"priority\":2}]}, \"synonyms\":{}}");

