	add("crosslet", "{\"term\":\"crosslet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027croiselette\u0027 alternatively, {{suffix|cross|let|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small cross with crossed arms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Edmund Spenser, \u0027The Faerie Queene\u0027, I.vi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then Vna gan to aske, if ought he knew, / Or heard abroad of that her champion trew, / That in his armour bare a \u0027\u0027croslet\u0027\u0027 red\", \"priority\":3}]}, \"synonyms\":{}}");

