	add("crosswordese", "{\"term\":\"crosswordese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crossword|ese|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The jargon of crossword puzzle answers, classically consisting of rare, archaic, or dialectal words\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Sam Hodges, \u0026quot;[http://articles.orlandosentinel.com/1988-03-20/lifestyle/0020430075_1_maleska-times-puzzle-times-puzzle Puzzlers Exchanging A Lot Of Cross Words]\u0026quot;, \u0027Orlando Sentinel\u0027, 20 March 1988\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;The Times puzzle is full of \u0027\u0027crosswordese\u0027\u0027 -- words nobody ever heard of,\u0026quot; he said. \u0026quot;Take today March 10. He\u0027s got the clue \u0027corn mush.\u0027 The answer is \u0027samp.\u0027 Then there\u0027s \u0027dwarf buffalo.\u0027 The answer is \u0027anoa.\u0027 It\u0027s laughable. I know these words because I\u0027m in the business. But why should you?\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

