	add("crotch", "{\"term\":\"crotch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|crotche}}, {{m|enm|croche}} {{gloss|also in unassilibated form {{m|enm|croke}}, \u0026quot;a shepherd\u0027s crook\u0026quot;}}, from Old french (842-ca. 1400) \u0027croche\u0027 (lang\u003dfro) merged with Middle english (1100-1500) {{m|enm|cruche}}, {{m|enm|crucche||a crutch}}. More at {{l/en|crook}}, {{l/en|crutch}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The area where something forks or branches, a ramification takes place\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There is a child sitting in a \u0027\u0027crotch\u0027\u0027 of that tree\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The (ventral) area of a person’s body where the legs fork from the trun\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Every mile they rode their \u0027\u0027crotches\u0027\u0027 felt worse saddlepain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Either the male or female genitalia\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He cringed at being kicked in the \u0027\u0027crotch\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In the three-ball carom game, a small space at each corner of the table\", \"priority\":7}]}, \"synonyms\":{}}");

