	add("crowdsourcing", "{\"term\":\"crowdsourcing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined 2006 by [http://archive.wired.com/wired/archive/14.06/crowds.html \u0027Wired\u0027 magazine writer Jeff Howe]. From {{compound|crowd|sourcing|lang\u003den}}, by analogy with \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"delegating a task to a large diffuse group in order to introduce new or more developed skill sets and improve efficiency. There is usually no substantial monetary compensation involved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"June 2006\u0027\u0027, Jeff Howe, \u0027Wired Magazine\u0027 14.06, \u0026quot;The Rise of Crowdsourcing\u0026quot; [http://www.wired.com/wired/archive/14.06/crowds.html?pg\u003d4\u0026amp;topic\u003dcrowds\u0026amp;topic_set\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;P\u0026amp;G is one of InnoCentive’s earliest and best customers, but the company works with other \u0027\u0027crowdsourcing\u0027\u0027 networks as well.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"January 2007\u0027\u0027, Jessi Hempel, \u0027Business Week\u0027, \u0026quot;Tapping the Wisdom of the Crowd\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;While not a new phenomenon, \u0027\u0027crowdsourcing\u0027\u0027 is really growing as a business trend.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"July 2007\u0027\u0027, Twisted, comp.lang.java.programmer\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Costs can be reduced by \u0027\u0027crowdsourcing\u0027\u0027 more content.\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

