	add("crowner", "{\"term\":\"crowner\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, crowns\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Beaumont and Fletche\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Oh, thou mother of delights, / \u0027\u0027Crowner\u0027\u0027 of all happy nights, / Star of dear content and pleasure, / Of mutual loves the endless treasure\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"corone\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1602\u0027\u0027 : w:William William Shakespeare, Hamlet\u0027 , act V scene\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027crowner\u0027\u0027 hath sat on her and finds it Christian burial\", \"priority\":6}]}, \"synonyms\":{}}");

